import React from 'react';

const Form = () => {
    return(
        <form>
            <input type="text" name="input-list" id="input-list"/>
            <button className="todo-button" type="submit">
            <i className="fas fa-plus-square"></i>
            </button>
            <div className="select">
                
            </div>
        </form>
    );
}

export default Form;
